// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import "animate.css";
import "../styles/Navbar.css"; // Make sure this exists

const Navbar = ({ user, onLogout }) => {
  return (
    <nav className="navbar animate__animated animate__fadeInDown">
      <div className="logo">
        <Link to="/">üõ´ FlyFast</Link>
      </div>
      <ul className="nav-links">
        {!user ? (
          <>
            <li><Link to="/login">üîê Login</Link></li>
            <li><Link to="/register">üìù Register</Link></li>
          </>
        ) : (
          <>
            <li className="user-info">üë§ {user.userEmail}</li>
            <li><button onClick={onLogout} className="logout-btn">üö™ Logout</button></li>
          </>
        )}
      </ul>
    </nav>
  );
};

export default Navbar;
